            "type": "string"
        },
        "context": {
            "type": "object"
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "onMount": "initialize",
        "render": "render"
    },
    "_viewModelId": "AwCellCommandBar",
    "_uniqueViewModelId": "AwCellCommandBar",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCellCommandBarRenderFunction, undefined, ctxImportObj );

export default Component;
